Pakai JSON object enak banget

anu({
param1: 1,
param2: "asda"<
callback: fn
})

anu({
param1 => 1,
param2 => "asda".
...
})

```from(User.ModelUsers) |> select([u], u.id) |> where(like("name","%widada%"))
{"SELECT u0."id" FROM "users" AS u0 WHERE ('name' LIKE '%widada%')", []}

from(User.ModelUsers) |> select([u], u.id) |> where([u], like(u.name,"%widada%"))
{"SELECT u0."id" FROM "users" AS u0 WHERE (u0."name" LIKE '%widada%')", []}```
